Here's a simple JavaScript code snippet that sorts the keys of an object (dictionary) alphabetically:

```javascript
let myDict = {
  "b": 2,
  "a": 1,
  "c": 3
};

// Sorting the keys alphabetically
let sortedKeys = Object.keys(myDict).sort();

// Creating a new object with sorted keys
let sortedDict = {};
for (let key of sortedKeys) {
  sortedDict[key] = myDict[key];
}

console.log(sortedDict); // Output: { "a": 1, "b": 2, "c": 3 }
```

This code first retrieves the keys of the dictionary using `Object.keys()`. Then it sorts these keys alphabetically using the `sort()` method. Finally, it creates a new object with the sorted keys and values from the original dictionary.
